import React, { Component } from 'react';

class Form extends Component {
    render() {
        return (
            <div>
                <div className="card" style="max-width: 202px;">
                    <div className="card-body">
                        <h4 className="card-title">Sun Gone</h4>
                        <h6 className="card-subtitle text-muted">Sun disappears!</h6>
                    </div>
                    <img src="/pix/samples/12s.jpg" alt="Photo of sunset"/>
                    <div className="card-body">
                        <p className="card-text">The sun disappeared behind the horizon today. Experts claim it could be gone for good!</p>
                    </div>
                </div>
            </div>
        )
    }
}

export default Form;
